import React from 'react';
import { NavBar, Header, Compatability, Footer } from './compatibility';
import '../compatability.css';


function App() {
  return (
    <div className="App">
      <NavBar />
      <Header />
      <Compatability memberId={'member1'} />
      <Footer />
    </div>
  );
}

export default App;
